import React from 'react';
import '../components/ProjectCard.css';
import Rose from '../components/rose.jpg';
import Container from 'react-bootstrap/Container';

// React component for the frontside of the card
class ProjectCard extends React.Component {
  render() {
   return(
<Container className="projectContainer" lg={auto}>
    <div className="row">
        <div class="col-12 mt-3">
            <div class="card">
                <div class="card-horizontal">
                    <div class="img-square-wrapper">
                        <img className="projectImage" src={Rose} alt="Card image cap"/>
                    </div>
                    <div class="card-body">
                        <h4 class="card-title">YelpCamp React Project</h4>
                        <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                </div>
                \
            </div>
        </div>
    </div>
</Container>


    );
  }
 }

 export default ProjectCard;
